import React from 'react';
import './TicTacToe.css';

const board = [
    'x', 'o',
    'o', 'x', null,
    'x', 'o', 'null',
];

const TicTacToe = () => {
    return <div>
        <div className='tic-tac-toe'>
    <h1>TicTacToe</h1>
    </div>

    <div>{
        board.map((item, index) => {
            return <h3 key={index}>{item }</h3>
        })}
    </div>
    </div>


}

export default TicTacToe;
